def compute_z_of_f(numbers):
    """"""

    def f(x):
        if x == 0 or x == 1:
            return 1
        return x * (x - 1) * f(x - 2)

    def z(x):
        t = f(x)
        a = 0
        while t % 10 == 0:
            t //= 10
            a += 1
        return a
    results = []
    for n in numbers:
        ans = 0
        i = 5
        while i <= n:
            ans += n // i
            i *= 5
        results.append(ans)
    return results
